import { motion } from 'framer-motion';

function App() {
  return (
    <div className="min-h-screen bg-gradient-to-r from-red-500 via-yellow-500 to-blue-500 p-6">
      <motion.h1 
        initial={{ opacity: 0, y: -50 }} 
        animate={{ opacity: 1, y: 0 }} 
        transition={{ duration: 0.5 }} 
        className="text-4xl font-bold text-white text-center mb-6"
      >
        Test Tailwind v3 Colors
      </motion.h1>
      <motion.button 
        whileHover={{ scale: 1.1 }} 
        whileTap={{ scale: 0.9 }} 
        className="bg-green-600 text-white p-4 rounded-lg mx-auto block hover:bg-green-700"
      >
        Click Me
      </motion.button>
    </div>
  );
}

export default App;
